var b="url",c="登录后讨论.html",d="generationDate",e=new Date(1589003593282.47),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="a46310e0f3b048dda839fed669bec623",u="type",v="Axure:Page",w="登录后讨论",x="notes",y="annotations",z="fn",A="1",B="ownerId",C="afda30f26fda49d2bcdacc142f1033cf",D="label",E="搜索",F="说明",G="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">参考apple官网搜索，</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">鼠标</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">放置</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">展示，点击后</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">抬头变成搜索栏，输入进行快速搜索。</span></p>",H="2",I="fd462757485e49a1a1ebe0ea0969e6c8",J="主页",K="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">单击跳转讨论页面</span></p>",L="3",M="77e3cfa72ae3459bb38bf71b9bb05cb7",N="制作",O="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">单击跳转制作页面</span></p>",P="4",Q="5ebd2ff5dc7e438dbc58df4539df35a5",R="发现",S="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">单击跳转发现页面</span></p>",T="5",U="15a00a997a4140a28dcc004e02093e99",V="logo只在不显示抬头时展现",W="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">只有在完全打开左边栏并且抬头完全没有显示的时候才会出现。</span></p>",X="6",Y="79b9a3186bd34826a7044f7f39e9b5bf",Z="左边栏扩展选项",ba="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">左边栏的预览和打开，左边栏为快捷栏目，包括用户</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">登录、搜索、联系官方、上传、语言/地域选择，等未登录的标准内容。（登录后展开自定义选项，在我的里面进行修改）</span></p><p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">左边栏在打开后会随着页面浏览向下，更类似与youtube的左边栏，感觉不动，动的是浏览内容。</span></p>",bb="7",bc="e75a4d3ec5fb41a5a4720ba9bd346ceb",bd="自定义快捷菜单6",be="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">跳转搜索页面</span></p>",bf="8",bg="c8bf0469a71241caa6c3dc50c7c29f15",bh="自定义快捷菜单3（上传）",bi="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">单击跳转上传界面</span></p>",bj="9",bk="ec725a8efc554d189f0dbf08d67d9617",bl="抬头栏",bm="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">正常开始显示logo+页面跳转的标签</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">，</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">之后浏览</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">只显示logo一行（在浏览时，如果鼠标滚轮向反方向</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">，或者鼠标移动到抬头logo</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">则显示完整抬头</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">）。</span></p><p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">如果开启了左边栏，在正常浏览时抬头栏不再显示。</span></p>",bn="10",bo="3c7903f8bd304848a727d3ceb3703ed7",bp="自定义快捷菜单1",bq="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">联系官方</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">，包含标准的邮件模式。如果是特殊情况点击这里进入后会对一些情况进行说明。</span></p>",br="11",bs="56688d864da641edab6ec0627142413f",bt="语言/地区选择",bu="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">点击跳转设置界面，此处为IP设置，一开始根据使用者的操作系统语言进行匹配，</span></p>",bv="12",bw="d4c374ca1157465c9dea970ab95e9a5a",bx="登录",by="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">未登录时显示未登录头像，登录后调用用户自己的排布，并且展示用户自己的头像。</span></p>",bz="13",bA="b03dba64c1e54fbf867d23ac49affe93",bB="左边栏位置显示与选择",bC="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">表示在第几页，并且可以点击跳转。</span></p>",bD="14",bE="59b97a262c4d4e999797cde44ac75296",bF="广告与推广栏",bG="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">标题栏or广告内容（可以分1-6幅进行选择播放）在后台进行定义</span></p>",bH="15",bI="1a71d313e10d4091ad3b06fc1d2315bf",bJ="(图片 )",bK="<p><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">直接接入云服务SDK</span><span style=\"font-family:'ArialMT', 'Arial', sans-serif;\">，界面可以考虑现成的，稍作修改。</span></p>",bL="16",bM="172e5de1bd4e47b5ac663d9e81d7438e",bN="(形状)",bO